import Link from 'next/link';
import Alert from "react-bootstrap/Alert";
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact Me"];
const linkStyle = {
  marginRight: 15
}
list = [
  'primary',
  'secondary',
  'success',
  'danger',
  'warning',
  'info',
  'light',
  'dark',
]
const Header = () => {
  return (
    <nav>
    {services_array.map(service => (
      <Link href={`/${(service.replace(" Me", '')).replace("Prabhakar Mishra", '')}`}>
        <a style={linkStyle}>{service}</a>
      </Link>
  ))}
  {list.map((variant, idx) => (
    <Alert key={idx} variant={variant}>
      This is a {variant} alert with{' '}
      <Alert.Link href="#">an example link</Alert.Link>. Give it a click if you
      like.
    </Alert>
  ))}
  </nav>
);
}

export default Header



